pragma solidity ^0.5.0;

contract DIRenewalService {
   string driverid;
   string expirationdate;
   string newdate;

function setDIRenewalChange(string memory _driverid, string memory _expirationdate, string memory _newdate) public {
      driverid = _driverid;
      expirationdate= _expirationdate;
      newdate = _newdate;
      
   }
   
   function getDIRenewalChange() public view returns (string memory ,string memory ,string memory ) {
       return ( driverid,expirationdate,newdate);
   
   }
    
}
